import React from "react";
import "./Head.css";
import { HiGlobeEuropeAfrica } from "react-icons/hi2";
const Head = () => {
  return (
    <section className="wrapper">
      {/*Left section*/}
      <div className="left">
        <div className="">
          <HiGlobeEuropeAfrica size={25} />
        </div>
        <select className="select">
          <option>Telugu</option>
          <option>English</option>
          <option>Hindi</option>
          <option>Tamil</option>
        </select>
      </div>
      {/*Right Section*/}
      <div className="right"></div>
    </section>
  );
};
export default Head;
